import React, { Component } from 'react'
import Main from "./components/Main"
import "./App.css"
export class App extends Component {

  state={
    items:[
      {id:1,content:"Lays"},
      {id:2,content:"Lays1"},
      {id:3,content:"Lays2"},
    ]
  }
  render() {
    return (
      <div className="App">
        h1.center.blue-text
        <Main />
      </div>
    )
  }
}

export default App
